INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1, "2030/01/01 14:59:59", 2, -416.5, 1, 0.0, "2025/01/31 12:00:00", "カリン", 190801, 3.414, 1000001, 62, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (2, "2030/01/01 14:59:59", 2, -416.5, 1, 0.0, "2025/01/31 12:00:00", "カリン", 190801, 3.099, 1000002, 62, "ミッションをクリアして、\n報酬をゲットしましょう！", 1);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (3, "2030/01/01 14:59:59", 2, -416.5, 1, 0.0, "2025/01/31 12:00:00", "カリン", 190801, 2.801, 1000003, 63, "受け取ることができる\n報酬があるようです\n確認してみてください", 1);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (4, "2030/01/01 14:59:59", 2, -416.5, 2, 0.0, "2025/01/31 12:00:00", "カリン", 190801, 0.0, 1000004, 63, "報酬がもらえますよ！\nチェックしてみてください", 1);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (5, "2030/01/01 14:59:59", 1, -363.0, 2, 0.0, "2025/01/31 12:00:00", "カリン", 190801, 2.12, 1000005, 64, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (6, "2030/01/01 14:59:59", 2, -363.0, 1, 0.0, "2025/01/31 12:00:00", "カリン", 190801, 1.68, 1000006, 64, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (7, "2030/01/01 14:59:59", 1, -363.0, 2, 0.0, "2025/01/31 12:00:00", "カリン", 190801, 2.33, 1000007, 64, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 7, -285.0, 3, -6.0, "2025/01/31 12:00:00", "ラビリスタ", 133701, 5.18, 1020101, 61, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 10201);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 2, -285.0, 1, -2.0, "2025/01/31 12:00:00", "クリスティーナ", 133901, 8.77, 1020102, 61, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 10201);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (301, "2030/01/01 14:59:59", 1, -285.0, 6, 0.0, "2025/01/31 12:00:00", "ネネカ", 133801, 15.5, 1020103, 61, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 10201);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 5, -285.0, 2, 0.0, "2025/02/28 12:00:00", "ランファ", 134301, 9.061, 1020201, 61, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 10202);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 2, -285.0, 1, 0.0, "2025/02/28 12:00:00", "チカ", 134401, 7.699, 1020202, 61, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 10202);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 2, -285.0, 1, 0.0, "2025/03/31 12:00:00", "アオイ", 134601, 8.595, 1020301, 61, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 10203);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 2, -285.0, 1, 0.0, "2025/03/31 12:00:00", "クローチェ", 134501, 7.758, 1020302, 61, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 10203);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 6, -285.0, 2, 0.0, "2025/04/30 12:00:00", "ルイズマリー", 132302, 7.0, 1020401, 61, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 10204);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 2, -285.0, 1, 0.0, "2025/04/30 12:00:00", "イロハ", 132402, 7.904, 1020402, 61, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 10204);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (301, "2030/01/01 14:59:59", 2, -285.0, 4, 0.0, "2025/04/30 12:00:00", "ソノ", 132502, 8.487, 1020403, 61, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 10204);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 2, -285.0, 1, 0.0, "2025/05/31 12:00:00", "カノン", 134901, 8.763, 1020502, 61, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 10205);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 3, -285.0, 1, 0.0, "2025/05/31 12:00:00", "ツムギ", 134801, 6.417, 1020503, 61, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 10205);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 7, -285.0, 3, 0.0, "2025/06/30 12:00:00", "エリス", 135001, 10.335, 1020601, 61, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 10206);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 4, -285.0, 2, 0.0, "2025/06/30 12:00:00", "シェフィ", 135101, 6.281, 1020602, 61, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 10206);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (301, "2030/01/01 14:59:59", 2, -285.0, 1, 0.0, "2025/06/30 12:00:00", "プレシア", 135201, 12.244, 1020603, 61, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 10206);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 8, -285.0, 2, 0.0, "2025/07/31 12:00:00", "クリア", 135301, 6.339, 1020701, 61, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 10207);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 9, -285.0, 7, 0.0, "2025/07/31 12:00:00", "アネモネ", 135401, 8.184, 1020702, 61, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 10207);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (101, "2030/01/01 14:59:59", 2, -285.0, 9, 0.0, "2025/08/31 12:00:00", "アイラ", 129101, 3.906, 1020801, 61, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 10208);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (201, "2030/01/01 14:59:59", 2, -285.0, 1, 0.0, "2025/08/31 12:00:00", "シナツ", 129201, 14.465, 1020802, 61, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 10208);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (301, "2030/01/01 14:59:59", 3, -285.0, 4, 0.0, "2025/08/31 12:00:00", "ヒヨリ", 100101, 8.662, 1020803, 61, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 10208);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (401, "2030/01/01 14:59:59", 3, -285.0, 1, 0.0, "2025/08/31 12:00:00", "レイ", 100301, 10.915, 1020804, 61, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 10208);
